import React from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';

function Roadmap() {
    var settings = {
        className: "",
        arrow: true,
        infinite: true,
        slidesToShow: 1,
        slidesToScroll: 1,
        adaptiveHeight: true
    };

    return (
        <RoadmapSection>
            <RoadmapContainer>
                <div>
                    <h2>Adaptive height</h2>
                    <Slider {...settings}>  
                        <div>
                            <RoadmapItemHolder>
                                <RoadmapItem>
                                    <RoadmapContent>
                                        <h3>Future is Now</h3>
                                        <p>Aliquam lorem ante, dapi bus in, viverra quis, feugi at a, tel lus. Phaselus vive</p>
                                    </RoadmapContent>

                                    <RoadmapHorizontal/>

                                    <RoadmapLine/>
                                </RoadmapItem>    
                            </RoadmapItemHolder>
                        </div>
                        <div>
                            <h3>2</h3>
                            <p>Hello</p>
                        </div>
                        <div>
                            <h3>3</h3>
                            <p>See ....</p>
                            <p>Height is adaptive</p>
                        </div>
                        <div>
                            <h3>4</h3>
                        </div>
                        <div>
                            <h3>5</h3>
                        </div>
                        <div>
                            <h3>6</h3>
                        </div>
                    </Slider>
                </div>
            </RoadmapContainer>
        </RoadmapSection>    
    );
}

const RoadmapSection = styled.section`
    color: #fff;
    background: #141515;

    padding: 0 10%;

    min-height: 550px;
    position: relative;
`

const RoadmapContainer = styled.div`

`

const RoadmapItemHolder = styled.div`

`

const RoadmapItem = styled.div``

const RoadmapContent = styled.div``

const RoadmapHorizontal = styled.div`
    height: 30px;
    background: #aceb2f;
    width: 3px;
    margin: auto;
`

const RoadmapLine = styled.div`
    width: 300px;
    height: 3px;
    background: #aceb2f;
    margin: auto;
    z-index: 2;
    margin-top: -3px;
`

export default Roadmap;
